from typing import List


class Solution:
    def divisibilityArray(self, word: str, m: int) -> List[int]:
        answer = [0] * len(word)
        for i in range(1, len(word) + 1):
            if int(word[:i]) % m == 0:
                answer[i - 1] = 1
        return answer

